import React from 'react';
import { Form, Button, Col, Row, Container } from "react-bootstrap";

function Home() { 
    return (
        <Container fluid>
            <h1>Triangle Problems Practice Tool</h1>
            <div sm={{ span: 5, offset: 1 }}>
            <Button variant="primary">Practice sin/cos/tan Problems</Button>
            </div>
            
        </Container>
    );
};

export default Home;
